import { BrowserRouter, Route, Routes } from "react-router-dom";
import Login from "components/login";
import Home from "components/home";

const Way = () => {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route index element={<Home />} to="/" />
          <Route element={<Login />} to="/login" />
        </Routes>
      </BrowserRouter>
    </>
  );
};
export default Way;
